Пылесос контейнерный бытовой без мешка Goldberg GB-1208

Контейнерный пылесос Goldberg GB-1208 – это бытовой пылесос циклонного типа без мешка для сбора пыли. В пылесосе используется технология мультициклон. Она подразумевает под собой систему, основанную на создании небольшого вихря. С его помощью мусор остается внутри контейнера. Мотор генерирует поток, под воздействием которого частицы пыли и грязи крутятся в области фильтрационной системы и оседают на стенках промежуточного контейнера.

Преимущества:

Удобное хранение и транспортировка;
Автоматическая намотка шнура;
Вращение шланга на 360 градусов, с воздушным потоком на ручке;
Индикатор наполнения пылесборника;
Удобная ручка для переноски;
Нера-фильтр;
4-х ступенчатая система фильтрации;
Блестящий корпус и эргономичный дизайн;
Качественный безмешковой пылесос для дома

Характеристики:

Мощность 3000 Вт;
Питание от сети 220V – 50 Гц
Тип уборки: Сухая
Тип пылесборника: Циклонный фильтр Контейнер
Объем пылесборника: 3 (л)
Щеток в комплекте: 2
Длина шнура: 3 метра
Комплектация:

Пылесос
Колба для сбора пыли
Шланг
Трубка
2 Насадки

Чайник електричний скляний  Quigg Glas 2400W 1,7л

Неймовірно елегантний скляний чайник від торгівельної марки Quigg швиденько і якісно закип'ятить воду для приготування ваших улюблених напоїв.

Електрочайник  Quigg Glas 2400W 1,7л має корпус із жаростійкого скла, комбінованого пластиком та нержавійкою. Всередині закритий нагрівальний елемент та підсвітка. Підставка з дисплеєм, є можливість контролю температури. Світлодіодне освітлення в нижній частині контейнера світиться в 5 різних кольорах під час роботи в залежності від температури

Нижче 50 ° C: зелений

50-60 ° C: блакитний

61-75 ° C: темно-синій

76-90 ° C: фіолетовий

91 ° C до: червоний.

Відкидна кришка, закривається за допомогою кнопки.

Є індикатор рівня води та роботи. Чайник має великий об'єм - 1,7 літри, цього більш ніж достатня для 8 чоловік. Модель зручна у користуванні, не вибаглива у догляді.

Технічні характеристики:

об'єм: 1,7 л;

елегантний, сучасний дизайн;

яскрава світлодіодна підсвітка підчас роботи;

високоякісний вихід;

практична кнопка для відкриття кришки;

автоматичне вимкнення;

контроль температури 40-100° 

матеріали: пластик + скло+ нержавійка;

потужність: 2400 Вт.

