Бомбическая! напичканная модель от Earfun !!

Отличнейшее сочное динамичное звучание от мастеров тюнинга Earfun !!

Дизайн aля Airpods Pro - очень удобные, с достойным активным шумоподавлением, плюс хороший прозрачный режим для слышимости всего вокруг;
приличное время работы до 6 часов (с кейсом до 30ч);
Джекпот вам - функция мультипоинт для одновременного подключения сразу к двум устройствам, к телефону и к ноутбуку, например, что большая редкость в этом бюджете!
микрофоны просто отлично! справляются со своей задачей как в помещении так и на улице;
есть приложение для более гибкой подстройки наушников под себя с возможностью полной перенастройки сенсорного управления и с фирменными и ручным эквалайзерами;
на борту также игровой режим с пониженной задержкой для видео и игр;
защита от влаги IPX5 - спорту быть;
управление полное, громкостью в том числе, которая с большим запасом;
наушники имеют быструю зарядку - 10мин в кейсе - твои 2 часа прослушивания музыки;
сам кейс небольшой имеет беспроводную зарядку и всегда с собой, ведь это же такая важная вещица, куда без неё..куда без музыки..))

Да что тебе ещё ннадо? =)

